import logo from './logo.svg';
import {useEffect, useState} from "react";
import './App.css';
import Axios from 'axios';

function App() {
    const [data, setData] = useState([])

    useEffect(() => {
        Axios.get('https://jsonplaceholder.typicode.com/todos')
            .then(res => {
                console.log(res.data)
                setData(res.data)
            })
            .catch(err => console.log(err))
    }, [])

    const array = data.map((data, index) => {
        return (
            <div className="card" style="width: 18rem;">
                <div className="card-body">
                    <h5 className="card-title">Особое обращение с заголовком</h5>
                    <p className="card-text">С вспомогательным текстом ниже в качестве естественного перехода к
                        дополнительному контенту.</p>
                    <a href="#" className="btn btn-primary">Перейти куда-нибудь</a>
                </div>
            </div>

        )
    })
  return (
    <div className="App">
        {array}
    </div>


  );
}

export default App;
